using namespace std;

bool check(vector<vector<int>> &M, vector<int> &a, int n){
    for(int i=0; i<n;++i)
        for(int j=0; j<i;++j)
            if(M[i][j] != (a[i] | a[j]))
                return false;
                
    return true;
    
}

int main(int argc, char *argv[])
{
	ios_base::sync_with_stdio(false);
    cin.tie(NULL);
	
	int t;
	
	cin>>t;
	
	for(int i=0; i<t; ++i){
	     int n;
	     cin>>n;
	     vector<vector<int>> M(n, vector<int>(n));
	     for(auto &row: M)
	        for(auto &column: row)
	            cin>>column;
	            
	    vector<int> a(n);
	    
	    for(int i=0; i<n; ++i){//column
	        int mask = (1<<30) -1;
	        for(int j=0; j<n; ++j){//row
	             if(i==j)  
	                 continue;
	             mask &= M[i][j];
	        }
	        a[i]=mask;
	    }
	    if(check(M,a,n)){
	         cout<<"YES"<<endl;
	         for(auto &it: a)
	             cout<<it<<" ";
	             
	        cout<<endl;
	    }
	    else
	        cout<<"NO"<<endl;
	}
    return 0;	
}

